import styled from 'styled-components'

export const Marker = styled.div`
    display: block;
  background-color: yellow;
  border: none;
  background-size: cover;
  width: 20px;
  height: 20px;
  cursor: pointer;
  background-image: url("../../assets/landlines_marker.svg");
  color: #fff;
  font-size: 14px;
  text-align: left;
  font-weight: 800;
  position: relative;

`
